import React, { Component} from 'react'
import ReactDOM from 'react-dom'
import QuestionList from "./QuestionList"

 
export class App extends Component {



    render() {
        return (
            <div>
                <div> List of Data
                  <QuestionList />
                </div>
                <hr></hr>
            </div>
        )
    }
}


ReactDOM.render(<App></App>, document.getElementById("root"))
